import styled from 'styled-components'

const LoginStyles = styled.div`
  max-width: ${({ theme }) => theme.maxWidth};
  display: flex;
  justify-content: center;
  div {
    height: 380px;
    width: 350px;
    background-color: white;
    margin-top: 1.2rem;
  }
`

const Login = () => (
  <LoginStyles>
    <div></div>
  </LoginStyles>
)

export default Login
